import React from 'react';

const ChatList = () => {
  return (
    <section className="sm:w-[400px] w-full h-full bg-white duration-200 p-5 drop-shadow-[0_10px_10px_rgba(25,93,174,0.5)] dark:bg-[#1b1b1b] md:mr-10">
      <div className="flex">
        <input
          type="text"
          placeholder="Search"
          className="w-full text-sm bg-[#1b1b1b10] rounded-sm p-1"
        />
      </div>
      <ul>
        <li></li>
      </ul>
    </section>
  );
};

export default ChatList;
